!function(){"use strict";$.getJSON(window.apiUrl+"/food/list/"+window.username+"/?liked=true",function(i){var n=$(".template").children().first().clone();$.each(i,function(i,e){var t=n.clone();t.find(".name").text(e.name),t.find(".price").text(e.price),t.find(".num_likes .num").text(e.num_likes),t.find(".food-photo img").attr("src","images/"+e.photo),t.find(".food-photo, .info").wrap('<a href="food.html?id='+e.id+'"></a>'),$(".main-div").append(t)})})}();